import {Link} from "react-router-dom";
import './Home.css';


const Home = () => {
    return (
       <div className="home p-md-5 mx-auto col-xl-10 col-lg-11 col-md-11 col-sm-12">
           <div className="row d-flex justify-content-around">
                <div className=".marvel-circle{
    background: url('../../images/universes-nav/marvel.jpg');
    overflow:hidden;
    background-repeat: no-repeat;
    background-size: cover;
    background-position: center;
}col-xl-8 col-lg-8 col-md-8 col-sm-12 p-5 mb-5  bg-primary d-flex justify-content-center align-items-center">
                    Collections
                </div>
                <div className="col-xl-3 col-lg-3 col-md-3 col-sm-12 mb-5 bg-secondary d-flex justify-content-center align-items-center">
                    Alexis
                </div>
           </div>
           <div className="row d-flex justify-content-around">
                <div className="col-xl-3 col-lg-3 col-md-3 col-sm-12 bg-secondary d-flex justify-content-center align-items-center">
                    Alexis
                </div>
                <div className="col-xl-8 col-lg-8 col-md-8 col-sm-12 p-5 bg-primary d-flex justify-content-center align-items-center">
                    Tom
                </div>
           </div>
       </div>
    );
}

export default Home;
